function convertJson(data) {
  var demandJson = {
    "itemNumber": data["Item Number"],
    "gsl": data.GSL,
    "vendorSiteCode": data["Vendor Site Code"],
    "weeksData": []
  };
  var demandKeys = Object.keys(data);
  demandKeys.reduce((acc = 0, ee, ii, arrr) => {
      if (ee.includes("wk")) {
          if((ee.split("-")[1].trim() < currFisYear)   && !flagFis){
              flagFis=true;
          }
          if (data["Planned Details"] == "Supplier Commit") {
              demandJson.weeksData.push({
                  "fiscalWeek": ee.split("-")[1].trim(),
                  "commitment": Number(data[ee]),
                  "pvcommitment": Number(data[ee]) + Number(acc)
              });
          } else {
              demandJson.weeksData.push({
                  "fiscalWeek": ee.split("-")[1].trim(),
                  "demand": Number(data[ee]),
                  "pvdemand": Number(data[ee]) + Number(acc)
              });
          }
          return Number(data[ee]) + Number(acc);
      }
  });
  return demandJson;
}
